        textAlign:'center',
        padding:'15px',
        margin:'auto',
        borderRadius:'10px',
        color:'black'
    },
    para:{
        fontSize:'1.5em',
        fontWeight:'500'
    },
    input: {
        border: '1px solid lightgray',
        padding: '4px',
        borderRadius: '3px',
        margin: '.5rem',
        width: '100%'
    },

